import { createTheme } from '@mui/material';

export const theme = createTheme({
    palette: {
        primary: {
            main: '#000000',
        },
        secondary: {
            main: '#87837A',
        }

    },
});

// 1 '#F7F5E9'
// 2 '#9AB3B4'
// 3 '#87837A'
